import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Header from './Components/Head/head.js';

class App extends React.Component {
  render() {
    return(
      <>
        <Header />
        <img alt="" src='/logo.png' />
      </>
    )
  }
}

ReactDOM.render(
  <App />,
  document.getElementById('root')
);
